import React from "react";
import { Button } from "antd";

export default function Register() {
  function handleRegister() {
    fetch("http://localhost:3000", {
      method: "post",
      body: JSON.stringify({
        firstName: "Test",
        lastName: "Paul",
        username: "paulchan",
        password: "123456",
      }),
    })
      .then((res) => {
        return res.json();
      })
      .catch((error) => {
        console.log(error);
      });
  }

  return (
    <div>
      Register
      <Button onClick={() => handleRegister()}>Register</Button>
    </div>
  );
}
